window.bookSummaryJSON = "<p><b>Only his ropes can unravel the past. </b></p> <p>I never thought I’d see him again, but when my former best friend shows up ready to make amends, it becomes clear just how tied to the past I am. He disappeared when I needed him the most, leaving me to navigate my truth alone. Now he’s back. </p> <p>Nixon’s art leaves me vulnerable, defenseless - and I like it. Bound by desire and past hurts, giving him complete control might be exactly what I need to set me free. What neither of us expected? The ropes free him, too....</p> <p><i>Free Me </i>is a sensual second-chance, former-friends-to-lovers, bisexual awakening story featuring <i>shibari</i>. It is book three in the Tattoos and Temptation series, featuring hot Miami nights, Latin desserts, and guys with ink.</p>"; 
